import React, { useState } from "react";
import axios from "axios";

const Dashboard = () => {
  const [email, setEmail] = useState("");
  const [citizen, setCitizen] = useState(null);

  const fetchCitizen = async () => {
    try {
      const res = await axios.get(`http://localhost:8081/api/auth/citizen?email=${email}`);
      setCitizen(res.data);
    } catch (err) {
      console.error("Citizen not found", err);
      setCitizen(null);
    }
  };

  return (
    <div className="p-6">
      <h2 className="text-xl font-bold mb-4">Citizen Dashboard</h2>

      {/* Search by email */}
      <div className="mb-4">
        <input
          type="email"
          placeholder="Enter citizen email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          className="border p-2 rounded mr-2"
        />
        <button
          onClick={fetchCitizen}
          className="bg-blue-500 text-white px-4 py-2 rounded"
        >
          Fetch Citizen
        </button>
      </div>

      {/* Auto-filled fields */}
      {citizen && (
        <div className="grid gap-3">
          <input type="text" value={citizen.firstName} readOnly className="border p-2 rounded" />
          <input type="text" value={citizen.lastName} readOnly className="border p-2 rounded" />
          <input type="text" value={citizen.email} readOnly className="border p-2 rounded" />
          <input type="text" value={citizen.phone} readOnly className="border p-2 rounded" />
          <input type="text" value={citizen.nic} readOnly className="border p-2 rounded" />
        </div>
      )}
    </div>
  );
};

export default Dashboard;
